        return error;
      }
    },
    async removeTeamMember(id) {
      console.log(id);

      this.$store.commit("SET_SELECTED_TEAM_MEMBER_ID", {
        id: id
      });

      try {
        await this.$store.dispatch("setAdminDeleteProjectTeam");
        await this.$store.dispatch("setAdminProjects");
      } catch (error) {
        return error;
      }
    }
